import { useSpring, animated } from "@react-spring/web";
import { useEffect, useRef, useState } from "react";
import {
  TransformComponent,
  TransformWrapper,
  useControls,
} from "react-zoom-pan-pinch";
import Raw from "../NQ/raw";
import Controls from "../Controls";
import useSize from "@react-hook/size";

import { toPng } from "html-to-image";
import download from "downloadjs";

import bg from "~/assets/images/guitar/ep_naturalwhite.webp";

interface PhotoBoothProps {
  open: boolean;
  onClose: () => void;
}

function Flashbulb({ run }: { run: number | undefined }) {
  const [styles, api] = useSpring(() => ({
    from: { opacity: 0 },
  }));

  useEffect(() => {
    if (!run) return;
    api.start({
      opacity: 1,
      config: { duration: 100 },
      onRest: () => {
        api.start({ opacity: 0, config: { duration: 100 } });
      },
    });
  }, [run]);

  return (
    <animated.div
      className="bg-white absolute inset-0 z-50 pointer-events-none"
      style={styles}
    ></animated.div>
  );
}

interface PassthruProps {
  positionX: number;
  positionY: number;
  scale: number;
  open: boolean;
}

const Passthru = (props: PassthruProps) => {
  const { setTransform } = useControls();

  useEffect(() => {
    if (!props.open) return;
    setTransform(props.positionX, props.positionY, props.scale, 0);
  }, [props.open, props.positionX, props.positionY, props.scale]);

  return null;
};

export default function PhotoBooth({ open, onClose }: PhotoBoothProps) {
  const [styles, api] = useSpring(() => ({
    from: { transform: "translate(0, -100%)", opacity: 0 },
  }));

  const ref = useRef<HTMLDivElement>(null);

  const target = useRef<HTMLDivElement>(null);
  const [width, height] = useSize(target);

  const [screen, setScreen] = useState<number | undefined>(undefined);

  useEffect(() => {
    if (open) {
      api.start({ transform: "translate(0, 0)", opacity: 1 });
    } else {
      api.start({ transform: "translate(0, -100%)", opacity: 0 });
    }
  }, [open, api]);

  const takeScreenshot = () => {
    if (!ref.current) return;
    setScreen(Date.now());
    toPng(ref.current, {
      cacheBust: true,
      canvasHeight: 1024,
      canvasWidth: 1024,
    })
      .then((dataUrl) => download(dataUrl, "my-node.png"))
      .catch((err) => {
        console.error("oops, something went wrong!", err);
      });
  };

  const { instance } = useControls();
  return (
    <animated.div className="fixed inset-0 z-10" style={styles}>
      <Flashbulb run={screen} />
      <TransformWrapper>
        <Passthru
          open={open}
          scale={instance.transformState.scale}
          positionX={instance.transformState.positionX}
          positionY={instance.transformState.positionY}
        />
        <div className="inset-0 absolute bg-white z-10 p-4 flex flex-col">
          <a
            className="absolute btn btn-square top-4 right-4 z-20"
            onClick={onClose}
          >
            <svg
              xmlns="http://www.w3.org/2000/svg"
              className="h-6 w-6 text-black"
              fill="none"
              viewBox="0 0 24 24"
              stroke="currentColor"
            >
              <path
                strokeLinecap="round"
                strokeLinejoin="round"
                strokeWidth={2}
                d="M6 18L18 6M6 6l12 12"
              />
            </svg>
          </a>
          <div className="relative flex-1 w-full overflow-hidden" ref={target}>
            <div
              className="bg-amber-950 aspect-square m-auto"
              style={width > height ? { height } : { width }}
            >
              <div className=" bg-repeat w-full aspect-square relative overflow-hidden">
                <div
                  ref={ref}
                  className="absolute inset-0 overflow-hidden"
                  style={{ backgroundImage: `url(${bg.src})` }}
                >
                  <TransformComponent
                    wrapperStyle={{
                      width: "100%",
                      height: "100%",
                    }}
                    contentStyle={{
                      width: "100%",
                      height: "100%",
                    }}
                  >
                    <Raw />
                  </TransformComponent>
                  <svg
                    width="600"
                    height="600"
                    viewBox="0 0 600 600"
                    fill="none"
                    xmlns="http://www.w3.org/2000/svg"
                    className="absolute top-0 left-0 w-full h-full pointer-events-none"
                  >
                    <g clip-path="url(#clip0_95_326)">
                      <rect
                        x="-171.919"
                        y="175.826"
                        width="555.379"
                        height="136.958"
                        transform="rotate(-34.5277 -171.919 175.826)"
                        fill="#A32D21"
                      />
                      <rect
                        x="-15"
                        y="53.3488"
                        width="205.936"
                        height="126.808"
                        transform="rotate(-19.089 -15 53.3488)"
                        fill="url(#pattern0_95_326)"
                      />
                    </g>
                    <defs>
                      <pattern
                        id="pattern0_95_326"
                        patternContentUnits="objectBoundingBox"
                        width="1"
                        height="1"
                      >
                        <use
                          xlinkHref="#image0_95_326"
                          transform="scale(0.000615764 0.001)"
                        />
                      </pattern>
                      <clipPath id="clip0_95_326">
                        <rect width="600" height="600" fill="white" />
                      </clipPath>
                      <image
                        id="image0_95_326"
                        width="1624"
                        height="1000"
                        preserveAspectRatio="none"
                        xlinkHref="data:image/png;base64,"
                      />
                    </defs>
                  </svg>
                </div>
                <Controls photo={false} />
              </div>
            </div>
          </div>
          <div className="w-full flex flex-row items-center justify-center py-4 mt-10 h-20">
            <a
              className="btn rounded-full btn-xl btn-square btn-error"
              onClick={takeScreenshot}
            ></a>
          </div>
        </div>
      </TransformWrapper>
    </animated.div>
  );
}
